import React from "react";

function DisplayMsgs({ msgs }) {
  let msgsArray = msgs.map((msg, index) => {
    return <h2 key={index}>{msg}</h2>;
  });
  return <div>{msgsArray}</div>;
}

export default DisplayMsgs;
